export class CartItem {
    constructor(id, title, quantity, imageUrl, price, totalAmount) {
        this.id = id
        this.title = title
        this.quantity = quantity
        this.price = price
        this.totalAmount = totalAmount
        this.imageUrl = imagerl
    }
}
